import React, { useState } from "react";
import "./styles.css";

class GameList extends Component {
  constructor() {
    super();
    this.state = {
      games: [],
    }
  };

  componentDidMount() {

    fetch('http://localhost:4999/ls')
      .then(results => {
        return results.json();
      }).then( data => {
        let games = data.results.map(game => {
          return(
            <div key={game.results}>
              <li><a href="localhost:5555/">{game.number} issued at {game.issued}</a></li>
            </div>
          )
        })
      this.setState({games: games});
      console.log("state",this.state.pictures)      
      })
  };

  render() {
    return(
      <div className="container2">
        <div className="container1">
          {this.state.games}
        </div>
      </div>
    )}
}
